To add labels to associations in PlantUML, you can use the following syntax:

```
[Class1] "label1" [association_type] "label2" [Class2]
```

Here's an example:

```
@startuml
class Person {
  name: String
  age: int
}

class Car {
  make: String
  model: String
}

Person "owns" -- "1" Car : "has"
@enduml
```

In this example, the association between `Person` and `Car` has two labels: "owns" and "has". The "1" on the `Car` side of the association indicates that a person can own one car.

You can also add role names to the association ends:

```
[Class1] "role1" [association_type] "role2" [Class2]
```

For example:

```
@startuml
class Person {
  name: String
  age: int
}

class Car {
  make: String
  model: String
}

Person "owner" -- "vehicle" Car
@enduml
```

In this case, the role names are "owner" and "vehicle".

Remember that the association type can be one of the following: `--` (association), `<|--` (generalization), `*--` (composition), `o--` (aggregation), or `-->` (dependency).
